// ClipboardJS Settings


var clipboard = new ClipboardJS(".aryafonts", {
    text: function (trigger) {
        return $(trigger).find("p").text();
    }
});
clipboard.on('success', function (e) {
    var btn = $(e.trigger);
    btn.append('<button>Copied!</button>');
    btn.find('button').delay(2000).fadeOut(500, function () { $(this).remove(); });
    $('body').append('<p class="copied"><input class="text" value="' + btn.find("p").text() + '" /><span class="copybtn">‚úî Copied !</span></p>'), setTimeout(function () { $('.copied').remove(); }, 2000)

});

clipboard.on('error', function (e) {
    console.error('Action:', e.action);
    console.error('Trigger:', e.trigger);
});



